for i, cat_col in enumerate(cat_cols):
    for j, num_col in enumerate(num_cols):
        sns.scatterplot(data=subset_df, x=num_col, y=cat_col, ax=axes[i, j])
        axes[i, j].set_title(cat_col + ' vs ' + num_col)

